import { useState } from "react";
import SearchBar from "./SearchBar";

export default function Front() {
  const [searchBar, setSearchBar] = useState(false);

  return (
    <section className="relative z-10">
      <div className="sm:w-11/12 mx-auto">
        <div className="relative py-8 sm:rounded-3xl w-full h-[620px] bg-homefrontbg bg-cover lg:bg-center bg-no-repeat bg-left">
          {/* Text above the image */}
          <div className="absolute top-0 left-0 w-full text-center py-4">
            <p className="text-white text-[30px] font-bold bg-black bg-opacity-50 inline-block px-4 py-2 rounded-md">
              Your Text Here
            </p>
          </div>
  
          {/* Other elements */}
          <div className="absolute bottom-[24%] sm:left-[6%] left-[5%] flex items-center flex-wrap gap-4">
            {/* Search bar or other content */}
          </div>
        </div>
      </div>
    </section>
  );       
}
